import React, { useState, useEffect } from 'react';
import { ModernHotelCard } from './ModernHotelCard';
import { Filter } from './Filter';

export function HotelsPage(props) {
  const [filteredHotels, setFilteredHotels] = useState([]);
  const [sortedHotels, setSortedHotels] = useState([]);
  const [filters, setFilters] = useState({
    search: '',
    island: 'all',
    price: 'all',
    amenities: []
  });

  // Get unique tags from hotel data
  const uniqueTags = [...new Set(props.cardData
    .filter(card => card.category === "hotel")
    .flatMap(hotel => hotel.tags))];

  // Filter hotels data
  useEffect(() => {
    let hotels = props.cardData.filter((cardObj) => cardObj.category === "hotel");

    // Apply search filter
    if (filters.search) {
      hotels = hotels.filter(hotel => 
        hotel.title.toLowerCase().includes(filters.search.toLowerCase()) ||
        hotel.description.toLowerCase().includes(filters.search.toLowerCase()) ||
        hotel.island.toLowerCase().includes(filters.search.toLowerCase())
      );
    }

    // Apply island filter
    if (filters.island !== 'all') {
      hotels = hotels.filter(hotel => hotel.island === filters.island);
    }

    // Apply price filter
    if (filters.price !== 'all') {
      hotels = hotels.filter(hotel => hotel.price === filters.price);
    }

    // Apply amenities filter
    if (filters.amenities.length > 0) {
      hotels = hotels.filter(hotel => 
        filters.amenities.some(amenity => hotel.tags.includes(amenity))
      );
    }

    setFilteredHotels(hotels);
    setSortedHotels(hotels);
  }, [props.cardData, filters]);

  const handleFilterChange = (newFilters) => {
    setFilters(prev => ({ ...prev, ...newFilters }));
  };

  // Callback for sorting
  const handleSortBy = (sortCriteria, isAscending) => {
    if (!sortCriteria) {
      setSortedHotels([...filteredHotels]);
      return;
    }

    const sorted = [...filteredHotels].sort((a, b) => {
      let aVal = a[sortCriteria];
      let bVal = b[sortCriteria];

      // Handle string comparison
      if (typeof aVal === 'string') {
        aVal = aVal.toLowerCase();
        bVal = bVal.toLowerCase();
      }

      if (aVal < bVal) return isAscending ? -1 : 1;
      if (aVal > bVal) return isAscending ? 1 : -1;
      return 0;
    });

    setSortedHotels(sorted);
  };

  // Callback for tag filtering
  const handleApplyFilter = (selectedTags) => {
    if (selectedTags.length === 0) {
      setSortedHotels(filteredHotels);
    } else {
      const filtered = filteredHotels.filter(hotel => 
        selectedTags.some(tag => hotel.tags.includes(tag))
      );
      setSortedHotels(filtered);
    }
  };

  return (
    <div className="hotels-page">
      <div className="container">
        <div className="hotels-layout">
          {/* Sidebar with existing Filter component */}
          <div className="hotels-sidebar">
            <Filter 
              cardData={filteredHotels}
              tags={uniqueTags}
              sortByCallback={handleSortBy}
              applyFilterCallback={handleApplyFilter}
            />
          </div>

          {/* Main content area */}
          <div className="hotels-main">
            <div className="hotels-header">
              <h1>Hotels</h1>
              <p className="results-count">
                {sortedHotels.length} hotel{sortedHotels.length !== 1 ? 's' : ''} found
              </p>
            </div>

            {sortedHotels.length === 0 ? (
              <div className="no-results">
                <div className="no-results-icon">🏨</div>
                <h3>No hotels found</h3>
                <p>Try adjusting your filters to see more options</p>
                <button 
                  className="btn btn-primary"
                  onClick={() => {
                    setFilters({
                      search: '',
                      island: 'all',
                      price: 'all',
                      amenities: []
                    });
                    setSortedHotels(filteredHotels);
                  }}
                >
                  Clear All Filters
                </button>
              </div>
            ) : (
              <div className="hotels-grid">
                {sortedHotels.map((hotel) => (
                  <ModernHotelCard 
                    key={hotel.cardId} 
                    hotel={hotel} 
                  />
                ))}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
